import React, { Component } from "react";
import "./style.css";
import Wicker from "./wicker.jpg"

class ResultCards extends Component {


    render() {
        return (
           <div className="card">
                <img className="result-poster" src={Wicker}></img>
                <div className="card-text">
                    <h1><span className="movie-name">The Wicker Man</span></h1>
                    <h2>(<span className="movie-year">1973</span>)</h2>
                </div>
                
           </div> 
        );
    }
}

export default ResultCards;
